import React from 'react'; 
import logoImg from '../../images/logo.svg';
import landingImg from '../../images/landing.svg';
import studyIcon from '../../images/icons/study.svg'; 
import giveClassIcon from '../../images/icons/give-classes.svg'; 
import purpleHeartIcon from '../../images/icons/purple-heart.svg'; 

function Landing() {
  return (
    <div id="page-landing">
      <div id="page-landing-content">
        <div id="logo-container">
          <img src={logoImg} alt="Proffy"/>
          <h2>Sua plataforma de estudos online.</h2>
        </div>
        <img
        src={landingImg} 
        alt="" 
        className="hero-image"
        />

        <div className="buttons-container">
          <a href="" className="study">
            <img src={studyIcon} alt="Estudar"/>
            Estudar
          </a>

          <a href="" className="give-classes">
            <img src={giveClassIcon} alt="Estudar"/>
            Estudar
          </a>
        </div>
        <span className="total-connections">
          Total de 200 conexões já realizadas <img src={purpleHeartIcon} alt="Corlção Roxo"/> 
        </span>
      </div>
    </div>

  )
}

export default Landing;
